import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div style={{ textAlign: 'center', paddingTop: '50px' }}>
      <h1>Welcome to LiveBoard!</h1>
      <p>The best place to find and post announcements.</p>
      <div style={{ marginTop: '30px' }}>
        <Link to="/announcements" style={{ marginRight: '20px', padding: '10px 20px', backgroundColor: '#007bff', color: 'white', textDecoration: 'none', borderRadius: '5px' }}>
          Browse Announcements
        </Link>
        <Link to="/create-announcement" style={{ padding: '10px 20px', backgroundColor: '#28a745', color: 'white', textDecoration: 'none', borderRadius: '5px' }}>
          Post an Ad
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
